window.bookSummaryJSON = "<p><i>Avegaaren Academy</i>.</p> <p>Where heroes compete, legends are born, and the heart of the Imperium’s might.</p> <p>Erik and Rugrat’s abilities will be pushed to the limit, honing their skills and allowing them to grow in new ways, ways they might not have thought of before.</p> <p>They stand to gain more than simple strength and more power.</p> <p>Here they might learn the purpose of the realms, how it was formed, why it was formed, and the three races that weaved their fates together against the darkness.</p>"; 
